# Determine durations between state changes, assume last state continues indefinitely.
# Check constraints for each transition:
# - Yellow must last exactly 3 seconds
# - All-red must last exactly 2 seconds
# - Green must last >=10 seconds

viol=[]
# Build list of (t, state)
states=[(e['time'], e['state']) for e in sched]

# Helper to classify phase

def phase(s):
    ns,ew=s['NS'],s['EW']
    if ns=='green' and ew=='red':
        return 'NS_GREEN'
    if ns=='yellow' and ew=='red':
        return 'NS_YELLOW'
    if ns=='red' and ew=='green':
        return 'EW_GREEN'
    if ns=='red' and ew=='yellow':
        return 'EW_YELLOW'
    if ns=='red' and ew=='red':
        return 'ALL_RED'
    return 'INVALID'

# Walk consecutive intervals
for i in range(len(states)-1):
    t0,s0=states[i]
    t1,s1=states[i+1]
    dur=t1-t0
    p0=phase(s0)
    if p0=='NS_YELLOW' or p0=='EW_YELLOW':
